import React, {useState, useEffect} from 'react';

import './ClientsStyle.css';
import '../../core/CoreStyle.css';
import { C_ButtonIcon, C_Modal, C_TextField, C_SelectVehicle, C_SelectVehicleBrand} from '../../core/Components/Components';
import helper from '../../core/helper';

export function Clients(props) {

    const [showModalClient, setShowModalClient] = useState(false);

    function showModal(){
        setShowModalClient(true);
    }

    function registerClient(){
        helper.Post("api/client/create",{Name:"the first", age: 18, state:"SC"},false,(err,ret)=>{
        
        });
    }

    return (
        <div className="page">
            <span className="div fade-in">
                <h1>Clientes</h1>
                <C_ButtonIcon onClick={showModal} icon="person_add" label="Cadastrar"/>
            </span>
            <C_Modal onSave={registerClient} onClose={() => setShowModalClient(false)} tittle={"Novo Cliente"} show={showModalClient}>
                
                <div style={{marginBottom:20}}>
                    <C_TextField outoFocus={true} style={{width: "100%"}} label="Nome" icon="person" placeholder=""/>
                </div>
                <div style={{ width: "100%", display: "flex", alignItems: "center", marginBottom:20}}>
                    <div style={{ width: "49%", marginRight: "2%"}}>
                        <C_TextField style={{ width: "100%" }} label="Celular" icon="phone_iphone" placeholder="" />
                    </div>
                    <div style={{ width: "49%"}}>
                        <C_TextField style={{width:"100%"}} label="Email" icon="email" placeholder=""/>
                    </div>
                </div>

                <div style={{ width: "100%", display: "flex", alignItems: "center", marginBottom:20}}>
                    <div style={{ width: "49%", marginRight: "2%"}}>
                        <C_SelectVehicle style={{ width: "100%" }} />
                    </div>
                    <div style={{ width: "49%"}}>
                        <C_SelectVehicleBrand style={{width:"100%"}} label="Marca" icon="email" placeholder=""/>
                    </div>
                </div>

            </C_Modal>
        </div>
    );
}
